(149, 10, 'who_we_are_description', 'OOPOQOO STUDIO is a Company started in the year 2022 which engages in 2D &amp; 3D design &amp; animation, PC &amp; Mobile gaming, Audio-Video Production, Motion Picture and Visual Effects . We bring with us years of experience and have put a together a team of creative individuals who have understanding of all the aspects of the creative field. We always focus on creating jaw dropping visuals content. We believe in delivering excellent creative visuals and providing impeccable experience to our business partners &amp; Clients.\r\n\r\nWe would love to tell your stories through top notch visuals and create an experience that people will remember for the ages to come.'),
