(505, 118, '_form', '<h4>Submit your application</h4>\n<div class=\"form-group\">\n    <label for=\"resume\">Resume/CV <em>*</em></label><div id=\"fileUpload\">[file* resume id:resume limit:2mb]</div>\n</div>\n<div class=\"form-group\">\n    <label for=\"full-name\">Full Name <em>*</em></label>[text* full-name id:full-name class:form-control placeholder \"\"]\n</div>\n<div class=\"form-group\">\n    <label for=\"email\">Email <em>*</em></label>[email* email id:email class:form-control placeholder \"\"]\n</div>\n<div class=\"form-group\">\n    <label for=\"phone\">Phone <em>*</em></label>[tel* phone id:phone class:form-control placeholder \"\"]\n</div>\n<div class=\"form-group\">\n    <label for=\"current-company\">Current Company <em>*</em></label>[text* current-company id:current-company class:form-control placeholder \"\"]\n</div>\n<div class=\"form-group\">Links</div>\n<div class=\"form-group\">\n    <label for=\"linkedin-url\">Linkedin URL</label>[text linkedin-url id:linkedin-url class:form-control placeholder \"\"]\n</div>\n<div class=\"form-group\">\n    <label for=\"portfolio-url\">Portfolio URL</label>[text portfolio-url id:portfolio-url class:form-control placeholder \"\"]\n</div>\n<div class=\"form-group\">\n    <label for=\"other-url\">Other URL</label>[text other-url id:other-url class:form-control placeholder \"\"]\n</div>\n<div class=\"form-group\">\n    <label for=\"additional-information\">Additional Information</label>[text additional-information id:additional-information class:form-control placeholder \"\"]\n</div>\n<div class=\"form-group\">\n[textarea cover-letter id:cover-letter class:form-control placeholder \"Add a cover letter or anything else you want to share\"]\n\n</div>\n<div class=\"form-group\">[text job-title id:job-title class:hidden-fields]</div>\n<div class=\"form-group\">\n[submit id:submit-application class:btn class:btn-custom \"Submit Application\"]\n</div>'),
(506, 118, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:35:\"[_site_title] \"Application for Job\"\";s:6:\"sender\";s:35:\"[_site_title] <connect@oopoqoo.com>\";s:9:\"recipient\";s:18:\"shahaji9@gmail.com\";s:4:\"body\";s:373:\"Job Title: [job-title]\nFull Name: [full-name]\nEmail    : [email]\nPhone    : [phone]\nCurrent Company: [current-company]\nLinkedin Profile: [linkedin-url]\nPortfolio URL   : [portfolio-url]\nOther URL       : [other-url]\nAdditional Information : [additional-information]\nCover Letter : [cover-letter]\n\n\n-- \nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\";s:18:\"additional_headers\";s:29:\"Reply-To: connect@oopoqoo.com\";s:11:\"attachments\";s:8:\"[resume]\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
(507, 118, '_mail_2', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:23:\"[_site_title] - Join Us\";s:6:\"sender\";s:35:\"[_site_title] <connect@oopoqoo.com>\";s:9:\"recipient\";s:7:\"[email]\";s:4:\"body\";s:317:\"<p>Hi [full-name],</p>\n<p>Thank you for your interest in roles with Oopoqoo Studio. We will review your application and get back to you if we have a suitable position. Regrettably, we are unable to get back to unsuccessful applications.</p>\n\n-- \nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\";s:18:\"additional_headers\";s:29:\"Reply-To: connect@oopoqoo.com\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:1;s:13:\"exclude_blank\";b:0;}'),
