(13908, 586, '_form', '<div class=\"form-fields\">[text* candidate-name class:contact-form-input placeholder \"Candidate Name\"]</div>\n<div class=\"form-fields\">[text* contact-number class:contact-form-input placeholder \"Contact Number\"]</div>\n<div class=\"form-fields\">[email* email class:contact-form-input placeholder \"Email\"]</div>\n<div class=\"form-fields\">[text* current-company class:contact-form-input placeholder \"Current Company\"]</div>\n<div class=\"form-fields\">[select* department class:contact-form-input first_as_label \"Department\" \"ROTO\" \"PAINT\" \"COMPOSITING\" \"TRACKING & MATCHMOVE\"]</div>\n<div class=\"form-fields\">[select* position-applied-for class:contact-form-input first_as_label \"Position Applied For\" \"INTERNSHIP\" \"JUNIOR LEVEL\" \"MID LEVEL\" \"SENIOR LEVEL\"]</div>\n<div class=\"form-fields\">[select* notice-period class:contact-form-input first_as_label \"Notice Period\" \"IMMEDIATE JOINER\" \"15 DAYS\" \"1 MONTH\" \"2 MONTH\"]</div>\n<div class=\"form-fields\">[text* current-ctc class:contact-form-input placeholder \"Current CTC\"]</div>\n<div class=\"form-fields\">[text* total-experience class:contact-form-input placeholder \"Total Experience\"]</div>\n<div class=\"form-fields\">[text* current-location class:contact-form-input placeholder \"Current Location\"]</div>\n<div class=\"form-fields\">[url showreel-link class:contact-form-input placeholder \"Showreel Link\"]</div>\n<div class=\"form-fields file-text\"><label>Upload Resume<em>*</em></label>\n[file* upload-resume limit:10mb class:contact-form-input]</div>\n<div class=\"form-fields\">[submit \"Submit\"]</div>'),
(13909, 586, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:36:\"[_site_title] \"Walk in Registration\"\";s:6:\"sender\";s:35:\"[_site_title] <connect@oopoqoo.com>\";s:9:\"recipient\";s:18:\"shahaji9@gmail.com\";s:4:\"body\";s:442:\"Name: [candidate-name]\nContact Number: [contact-number]\nEmail: [email]\nCurrent Company Name: [current-company]\nDepartment: [department]\nPosition: [position-applied-for]\nNotice Period: [notice-period]\nCurrent CTC: [current-ctc]\nTotal Experience: [total-experience]\nCurrent Location: [current-location]\nSHOWREEL LINK: [showreel-link]\nUPLOAD RESUME: [upload-resume] \n\n\n\n-- \nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\";s:18:\"additional_headers\";s:29:\"Reply-To: connect@oopoqoo.com\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
(13910, 586, '_mail_2', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:26:\"[_site_title] - Contact Us\";s:6:\"sender\";s:35:\"[_site_title] <connect@oopoqoo.com>\";s:9:\"recipient\";s:7:\"[email]\";s:4:\"body\";s:212:\"<p>Hi [your-name],</p>\n<p>Thank you for your interest in Oopoqoo Studio. Our Team will get back to you soon regarding your inquiry.</p>\n\n-- \nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\";s:18:\"additional_headers\";s:29:\"Reply-To: connect@oopoqoo.com\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:1;s:13:\"exclude_blank\";b:0;}'),
