(624, 1, '2022-07-29 17:48:38', '2022-07-29 17:48:38', '<!-- wp:list -->\n<ul><li>Contrary to popular belief, Lorem Ipsum is not simply random text. </li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li> Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.</li></ul>\n<!-- /wp:list -->', 'Animator', '', 'publish', 'closed', 'closed', '', 'animator', '', '', '2022-07-29 18:00:29', '2022-07-29 18:00:29', '', 0, 'https://localhost/oopoqoo-studio/?post_type=current_openings&#038;p=624', 0, 'current_openings', '', 0),
(626, 1, '2022-07-29 17:55:23', '2022-07-29 17:55:23', '<!-- wp:list -->\n<ul><li>Proven graphic designing experience</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>A strong portfolio of illustrations or other graphics</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Familiarity with design software and technologies (such as InDesign, Illustrator, Dreamweaver, Photoshop)</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>A keen eye for aesthetics and detailsExcellent communication skillsAbility to work methodically and meet deadlines</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Degree in Design, Fine Arts or related field is a plus</li></ul>\n<!-- /wp:list -->', 'Graphics designer', '', 'publish', 'closed', 'closed', '', 'graphics-designer', '', '', '2022-07-29 17:56:54', '2022-07-29 17:56:54', '', 0, 'https://localhost/oopoqoo-studio/?post_type=current_openings&#038;p=626', 0, 'current_openings', '', 0),
(640, 1, '2022-07-29 19:08:08', '2022-07-29 19:08:08', '<!-- wp:html -->\n<p>We also love to showcase our work, if you would like to have a look at our portfolio, \nplease drop in a line at <a href=\"connect@oopoqoo.com\">connect@oopoqoo.com</a>  and we will put up a show reel of \nstunning visuals for you</p>\n<!-- /wp:html -->', 'Services', '', 'publish', 'closed', 'closed', '', 'services', '', '', '2022-08-03 17:55:34', '2022-08-03 17:55:34', '', 0, 'https://localhost/oopoqoo-studio/?page_id=640', 0, 'page', '', 0),
