(737, 1, '2022-08-06 14:35:14', '2022-08-06 14:35:14', '<!-- wp:html -->\n<h2>Get In Touch For Business Enquiry</h2>\n<p>If you have a project which needs a team of committed and dedicated artists, we \nwould love to hear from you. With the range of services that we are offering, we will \nprovide you cutting edge solutions in the real-time space.</p>\n<p>If you would like to know more information regarding our services, or for any other \ngeneral inquiries, please share your details with us and our team will get in touch \nwith you.</p>\n<h5>Contact Form:</h5>\n<!-- /wp:html -->\n\n<!-- wp:shortcode -->\n[contact-form-7 id=\"69\" title=\"Contact Us\"]\n<!-- /wp:shortcode -->\n\n<!-- wp:html -->\n<h2>Contact Us At</h2>\n<ul><li><a href=\"mailto:connect@oopoqoo.com\">connect@oopoqoo.com</a></li></ul>\n<!-- /wp:html -->', 'Contact Us', '', 'inherit', 'closed', 'closed', '', '75-revision-v1', '', '', '2022-08-06 14:35:14', '2022-08-06 14:35:14', '', 75, 'http://localhost/oopoqoo/?p=737', 0, 'revision', '', 0),
